description:
 Cherie Deville is a corporate downsizer. It is her job to break the bad news to corporate employees after they have been fired. But it is not all bad news for newly unemployed grunts like Johnny Sins, for nothing softens the blow of getting laid off quite like spooging a pale load over Ms. Devilles succulent melons.
